        private Surface texture;

        public Rotozoomer(int w, int h)
            : base(w, h)
        {
        }

        public override void Update()
        {
            base.Update();

            if (texture == null)
                texture = FromMemoryPNG(MeanManData);

            // compute scale
            var angle = Frame/60.0; //  Math.Cos(frame/90.0)*4.5+Math.Sin(frame/157.0)*1.1;
            var scale = Math.Sin(angle) + 1; // in [0,2]
            scale = (scale + 0.50)/10.0; //  in [0.05,0.205]
            // rotation
            var cr = Math.Cos(angle);
            var sr = Math.Sin(angle);

            // step in texture space
            var tx = new Vector(1, 0);
            var ty = new Vector(0, 1);

            tx /= scale;
            ty /= scale;

            // rotate
            var t = cr*tx - sr*ty;
            ty = sr*tx + cr*ty;
            tx = t;

            for (var i = 0; i < Width; ++i)
                for (var j = 0; j < Height; ++j)
                {
                    int r, g, b;

                    var texel = (i - Width/2.0)*tx + (j - Height/2.0)*ty;

                    var tix = (int) (texel.X + texture.Width/2.0);
                    var tiy = (int) (texel.Y + texture.Height/2.0);
                    while (tix < 0) tix += texture.Width;
                    while (tiy < 0) tiy += texture.Height;
                    while (texture.Width <= tix) tix -= texture.Width;
                    while (texture.Height <= tiy) tiy -= texture.Height;

                    texture.GetPixel(tix, tiy, out r, out g, out b);

                    SetPixel(i, j, r, g, b);
                }
        }
    }
